import React, {Component} from "react";


export default class UserInformation extends Component {
    render() {

       const dataTable=this.props.dataTable;

        return (
            <table className="table">
                <thead>
                <tr>
                    <th>winner</th>
                    <th>date</th>
                </tr>
                </thead>
                <tbody>
                {dataTable.map(p =>
                    <tr>
                        <td key={p.id}>{p.winner}</td>
                        <td>{p.date}</td>
                    </tr>
                )

                }
                </tbody>
            </table>
    )
    }
   }
